int col_after_read(char c, int curCol) {
    if (c == '\n' || c == '\r') return 1;
    if (c == '\t') return curCol + 4;
    if (c == '\v') return curCol;
    return curCol + 1;
}

std::vector<LexUnit> Lexer::getAnalysis(std::string iFileName) {
    std::vector<LexUnit> lexVec;

    std::ofstream ofile;
    std::ofstream log, errorSiteFile;
    std::ifstream ifile;

    ifile.open(iFileName);
    ofile.open(iFileName + ".tokens.txt");
    log.open(iFileName + ".lex.log");
    errorSiteFile.open(iFileName + ".error.log");

    int currentLine = 1;
    int currentCol = 1;
    int lastCol = 0;

    char c;
    std::string s;
    c = ifile.get();
    lastCol = currentCol;
    currentCol = col_after_read(c, currentCol);
    while (c == ' ' || c == '\n' || c == '\t') {
        if (c == '\n') {
            currentLine++;
        }
        c = ifile.get();
        lastCol = currentCol;
        currentCol = col_after_read(c, currentCol);
    }
    while (1) {
        bool flag = false;
        while (c == ' ' || c == '\n' || c == '\t')
        {
            if (c == '\n') currentLine++;
            if (!ifile.eof()) {
                c = ifile.get();
                lastCol = currentCol;
                currentCol = col_after_read(c, currentCol);
                flag = true;
            }
            else break;
        }
        if (!flag && c != -1)
            s.append(1, c);
        std::string h = analysis(s);
        if (h == "MYERROR")
        {
            while (h == "MYERROR")
            {
                if (s.size() == 1) break;
                s.pop_back();
                ifile.seekg(-1, std::ios::cur);
                currentCol = lastCol;
                h = analysis(s);
            }
            ofile << s << '\t' << h << '\n';
            lexVec.emplace_back(LexUnit(s, h, currentLine, currentCol));

            if (h == "MYERROR") {
                currentCol = lastCol;
                errorSiteFile << currentLine << " " << currentCol;
                log << "lexical error (line " << currentLine
                    << ", col " << currentCol << "):Tokens error occur happened in word \""
                    << s << "\"." << std::endl;
                break;
            }
            s = "";
        }
        else if (h != "MYERROR" && flag)
        {
            ofile << s << '\t' << h << '\n';
            lexVec.emplace_back(LexUnit(s, h, currentLine, currentCol));
            s = "";
            ifile.seekg(-1, std::ios::cur);
            currentCol = lastCol;
        }
        if (!ifile.eof()) {
            c = ifile.get();
            lastCol = currentCol;
            currentCol = col_after_read(c, currentCol);
        }
        else {
            h = analysis(s);
            ofile << s << '\t' << h << '\n';
            lexVec.emplace_back(LexUnit(s, h, currentLine, currentCol));
            break;
        }
    }
    if (ifile.eof())
        log << "Tokens has been correctly generated. Total line is " << currentLine << " lines.";
    ifile.close();
    ofile.close();
    log.close();
    errorSiteFile.close();

    return lexVec;
}